import "./Board.css";
import RobotInGame from "./RobotInGame";

export default function Board() {
    const board = [];
    const xc = 10;
    const yc = 10;
    board.push(<RobotInGame x={xc} y={yc}/>);
    return (<div id="Board">{board}</div>);
}
